import { useEffect, useState } from "react";

const Chart = ({data, users}) => {
    const [times, setTimes] = useState([]);

    const getLegend = () => {
        console.log(data)
    }

    useEffect(() => {
        let tmp = [];

        for (let i = new Date().getTime() - 86400000; i < new Date().getTime(); i+=60000) {
            tmp.push(i);
        }
        setTimes(tmp)
        getLegend();
    }, [])

    return (
        <>
            {users?.map((user) => {
                return (
                    <div style={{display: "flex", flexDirection: "row", justifyContent: "space-evenly"}}>
                        {times?.map((time) => {
                            if (data.filter((dataItem) => user.username == dataItem.username && time == dataItem.timestamp).length != 0) {
                                return (
                                    <div style={{minWidth: "1px", minHeight: "5px", backgroundColor: "green", margin: "1px"}}>
    
                                    </div>
                                )
                            }
                            else {
                                return (
                                    <div style={{minWidth: "1px", minHeight: "5px", backgroundColor: "white", margin: "1px"}}>
    
                                    </div>
                                )
                            }
                            
                        })}
                    </div>
                )
            })}
        </>
    )
}

export default Chart;
